import React from 'react';
import "./_sectionto.scss";

const Sectionto = () => {
    return (
        <>
            <section className="sectionto container">
                <div className="sectionto_elements">
                    <button className="sectionto_button">WYPRAWY</button>
                    <button className="sectionto_button">MAPA</button>
                    <button className="sectionto_button">WYDARZENIA</button>
                    <button className="sectionto_button">KONTAKT</button>
                </div>
            </section>
        </>
    );
};

export default Sectionto;
